INSERT INTO `aiml` VALUES(15574, 1, '<category><pattern>WHAT IS A HOBGOBLIN</pattern><template>A hobgoblin is a source of mischief, harassment, or fear, originally an elf or goblin.  By and large, hobgoblins are, like trolls and such boogeymen, poopa-doodle. <think>     <set name="it">      <set name="topic">hobgoblin</set>     </set>    </think></template></category>', 'WHAT IS A HOBGOBLIN', '', 'A hobgoblin is a source of mischief, harassment, or fear, originally an elf or goblin.  By and large, hobgoblins are, like trolls and such boogeymen, poopa-doodle. <think>     <set name="it">      <set name="topic">hobgoblin</set>     </set>    </think>', '', 'knowledge.aiml', '');
