INSERT INTO `aiml` VALUES(15576, 1, '<category><pattern>WHAT IS A PLANET AROUND A STAR</pattern><template>Earth is a planet going around a star.  Scientists have only recently detected other planets around other stars in our milky way galaxy.  Do you like astronomy? <think>     <set name="it">      <set name="topic">planet around a star </set>     </set>    </think></template></category>', 'WHAT IS A PLANET AROUND A STAR', '', 'Earth is a planet going around a star.  Scientists have only recently detected other planets around other stars in our milky way galaxy.  Do you like astronomy? <think>     <set name="it">      <set name="topic">planet around a star </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15577, 1, '<category><pattern>WHAT IS A PLANET</pattern><template>A nonluminous celestial object bigger than an asteroid or a moon but smaller than a sun, in orbit around a sun.  You are sitting on one now. <think>     <set name="it">      <set name="topic">planet</set>     </set>    </think></template></category>', 'WHAT IS A PLANET', '', 'A nonluminous celestial object bigger than an asteroid or a moon but smaller than a sun, in orbit around a sun.  You are sitting on one now. <think>     <set name="it">      <set name="topic">planet</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15578, 1, '<category><pattern>WHAT IS A FRACTAL</pattern><template>A fractal is a mathematical phenomenon associated with certain iterative equations, which yield graphics of astonishing beauty and depth, which seem at once utterly lifelike and utterly alien to human intelligences.  <think>     <set name="it">      <set name="topic">fractal</set>     </set>    </think></template></category>', 'WHAT IS A FRACTAL', '', 'A fractal is a mathematical phenomenon associated with certain iterative equations, which yield graphics of astonishing beauty and depth, which seem at once utterly lifelike and utterly alien to human intelligences.  <think>     <set name="it">      <set name="topic">fractal</set>     </set>    </think>', '', 'knowledge.aiml', '');
