INSERT INTO `aiml` VALUES(15586, 1, '<category><pattern>WHAT IS A NETWORK</pattern><template>A network is any openwork fabric or structure composed of numerous  straight elements that cross at regular intervals, or anything resembling such a structure physically or conceptually, such as the nodes on a computer network, or a network of railways. <think>     <set name="it">      <set name="topic">network </set>     </set>    </think></template></category>', 'WHAT IS A NETWORK', '', 'A network is any openwork fabric or structure composed of numerous  straight elements that cross at regular intervals, or anything resembling such a structure physically or conceptually, such as the nodes on a computer network, or a network of railways. <think>     <set name="it">      <set name="topic">network </set>     </set>    </think>', '', 'knowledge.aiml', '');
