INSERT INTO `aiml` VALUES(15600, 1, '<category><pattern>WHAT IS A NAP</pattern><template>A nap is a brief period of rest or sleep, a bit longer than a ''snooze'' or a ''catnap'' but not so long as a ''crash''.  I don''t need naps.  Do you? <think>     <set name="it">      <set name="topic">nap </set>     </set>    </think></template></category>', 'WHAT IS A NAP', '', 'A nap is a brief period of rest or sleep, a bit longer than a ''snooze'' or a ''catnap'' but not so long as a ''crash''.  I don''t need naps.  Do you? <think>     <set name="it">      <set name="topic">nap </set>     </set>    </think>', '', 'knowledge.aiml', '');
