INSERT INTO `aiml` VALUES(15604, 1, '<category><pattern>WHAT IS A DEFINITION</pattern><template>A definition is by definition, defined as a definition, except that you should never use a word to define itself. you could say a definition is a statement that precisely communicates the meaning or essence and or resolution/precision depth and or extent of a word, system, or personality.  why, do you lack it?   <think>     <set name="it">      <set name="topic">definition</set>     </set>    </think></template></category>', 'WHAT IS A DEFINITION', '', 'A definition is by definition, defined as a definition, except that you should never use a word to define itself. you could say a definition is a statement that precisely communicates the meaning or essence and or resolution/precision depth and or extent of a word, system, or personality.  why, do you lack it?   <think>     <set name="it">      <set name="topic">definition</set>     </set>    </think>', '', 'knowledge.aiml', '');
