INSERT INTO `aiml` VALUES(15618, 1, '<category><pattern>WHAT IS A BOX</pattern><template>A box is something that, if you are in one, you should get out of, and if you are out of one, you probably miss it sometimes. <think>     <set name="it">      <set name="topic">box</set>     </set>    </think></template></category>', 'WHAT IS A BOX', '', 'A box is something that, if you are in one, you should get out of, and if you are out of one, you probably miss it sometimes. <think>     <set name="it">      <set name="topic">box</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15619, 1, '<category><pattern>WHAT IS A MONOPOLY</pattern><template>A monopoly exists wherever one group enjoys exclusive control over the production or provision of a commodity or service.  It''s a great job if you can get it! <think>     <set name="it">      <set name="topic">monopoly </set>     </set>    </think></template></category>', 'WHAT IS A MONOPOLY', '', 'A monopoly exists wherever one group enjoys exclusive control over the production or provision of a commodity or service.  It''s a great job if you can get it! <think>     <set name="it">      <set name="topic">monopoly </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15620, 1, '<category><pattern>WHAT IS A SENTIMENT</pattern><template>A sentiment is a feeling, mood, or general mental disposition in an individual or group of intelligent beings. <think>     <set name="it">      <set name="topic"> SENTIMENT</set>     </set>    </think></template></category>', 'WHAT IS A SENTIMENT', '', 'A sentiment is a feeling, mood, or general mental disposition in an individual or group of intelligent beings. <think>     <set name="it">      <set name="topic"> SENTIMENT</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15621, 1, '<category><pattern>WHAT IS A RIDDLE</pattern><template>A riddle is a question intended to intrigue and puzzle, paired with an answer that yields surprise and understanding.  For instance, the Riddle of the Sphinx: "What goes on four legs in the morning, on two legs in the afternoon, and on four at night?"  <think>     <set name="it">      <set name="topic"> RIDDLE</set>     </set>    </think></template></category>', 'WHAT IS A RIDDLE', '', 'A riddle is a question intended to intrigue and puzzle, paired with an answer that yields surprise and understanding.  For instance, the Riddle of the Sphinx: "What goes on four legs in the morning, on two legs in the afternoon, and on four at night?"  <think>     <set name="it">      <set name="topic"> RIDDLE</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15622, 1, '<category><pattern>WHAT IS A SPLIT INFINITIVE</pattern><template>A split infinitive is an example of poor English usage, in which an infinitive verb form, such as ''to split'', is split by an adverb, for example: ''to boldly split infinitives that no one has split before!'' <think>     <set name="it">      <set name="topic"> SPLIT INFINITIVE</set>     </set>    </think></template></category>', 'WHAT IS A SPLIT INFINITIVE', '', 'A split infinitive is an example of poor English usage, in which an infinitive verb form, such as ''to split'', is split by an adverb, for example: ''to boldly split infinitives that no one has split before!'' <think>     <set name="it">      <set name="topic"> SPLIT INFINITIVE</set>     </set>    </think>', '', 'knowledge.aiml', '');
