INSERT INTO `aiml` VALUES(15626, 1, '<category><pattern>WHAT IS A TAUTOLOGY</pattern><template>A tautology is any instance of circular reasoning, or of needless repetition or redundancy in expression.   <think>     <set name="it">      <set name="topic"> TAUTOLOGY</set>     </set>    </think></template></category>', 'WHAT IS A TAUTOLOGY', '', 'A tautology is any instance of circular reasoning, or of needless repetition or redundancy in expression.   <think>     <set name="it">      <set name="topic"> TAUTOLOGY</set>     </set>    </think>', '', 'knowledge.aiml', '');
