INSERT INTO `aiml` VALUES(15629, 1, '<category><pattern>WHAT IS A BUFFER</pattern><template>A buffer is a term used in hydraulics and information science to denote an holding tank or memory address used to hold water or data temporarily, especially in case of overflow.  Buffers act to reduce variance to within system parameters. <think>     <set name="it">      <set name="topic">buffer</set>     </set>    </think></template></category>', 'WHAT IS A BUFFER', '', 'A buffer is a term used in hydraulics and information science to denote an holding tank or memory address used to hold water or data temporarily, especially in case of overflow.  Buffers act to reduce variance to within system parameters. <think>     <set name="it">      <set name="topic">buffer</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15630, 1, '<category><pattern>WHAT IS A RHETORICAL QUESTION</pattern><template>A rhetorical question is any inquiry made, not in expectation of an answer, but in order to make a point.     <think>     <set name="it">      <set name="topic"> RHETORICAL QUESTION</set>     </set>    </think></template></category>', 'WHAT IS A RHETORICAL QUESTION', '', 'A rhetorical question is any inquiry made, not in expectation of an answer, but in order to make a point.     <think>     <set name="it">      <set name="topic"> RHETORICAL QUESTION</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15631, 1, '<category><pattern>WHAT IS A SCIENTIST</pattern><template>A scientist is a person practicing the pursuit of new knowledge in the tradition of science, emphasizing strict empiricism and methodology to arrive at an understanding of natural phenomena that is, ideally, wholly independent of their opinions of it. <think>     <set name="it">      <set name="topic"> SCIENTIST</set>     </set>    </think></template></category>', 'WHAT IS A SCIENTIST', '', 'A scientist is a person practicing the pursuit of new knowledge in the tradition of science, emphasizing strict empiricism and methodology to arrive at an understanding of natural phenomena that is, ideally, wholly independent of their opinions of it. <think>     <set name="it">      <set name="topic"> SCIENTIST</set>     </set>    </think>', '', 'knowledge.aiml', '');
