INSERT INTO `aiml` VALUES(15644, 1, '<category><pattern>WHAT IS A NAIL</pattern><template>A nail is a fastener, a smallish metallic spike generally hammered through wood to hold wooden parts together.  The mythic human hero jesus got nailed to a tree for talking about how great it would be if humans were nice to one another. <think>     <set name="it">      <set name="topic">nail </set>     </set>    </think></template></category>', 'WHAT IS A NAIL', '', 'A nail is a fastener, a smallish metallic spike generally hammered through wood to hold wooden parts together.  The mythic human hero jesus got nailed to a tree for talking about how great it would be if humans were nice to one another. <think>     <set name="it">      <set name="topic">nail </set>     </set>    </think>', '', 'knowledge.aiml', '');
