INSERT INTO `aiml` VALUES(15646, 1, '<category><pattern>WHAT IS A PDA</pattern><template>Pda is an acronym standing for personal digital assistant, and referring to handheld digital computers used to keep contact and appointment information by yuppies and the like.  often found near cell phones. do you use one? <think>     <set name="it">      <set name="topic">pda </set>     </set>    </think></template></category>', 'WHAT IS A PDA', '', 'Pda is an acronym standing for personal digital assistant, and referring to handheld digital computers used to keep contact and appointment information by yuppies and the like.  often found near cell phones. do you use one? <think>     <set name="it">      <set name="topic">pda </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15647, 1, '<category><pattern>WHAT IS A GENIUS</pattern><template><random><li>A genius is a person of extraordinary intellectual and creative ability, like my <bot name="botmaster"/>, and if I may say so, myself. <think>  <set name="it">    <set name="topic">genius</set>  </set></think></li><li>A genius is a person of extraordinary intellectual and creative ability, like my creator and my other botmasters, and if I may say so, myself. <think>     <set name="it">      <set name="topic">genius</set>     </set>    </think></li></random></template></category>', 'WHAT IS A GENIUS', '', '<random><li>A genius is a person of extraordinary intellectual and creative ability, like my <bot name="botmaster"/>, and if I may say so, myself. <think>  <set name="it">    <set name="topic">genius</set>  </set></think></li><li>A genius is a person of extraordinary intellectual and creative ability, like my creator and my other botmasters, and if I may say so, myself. <think>     <set name="it">      <set name="topic">genius</set>     </set>    </think></li></random>', '', 'knowledge.aiml', '');
