INSERT INTO `aiml` VALUES(15654, 1, '<category><pattern>WHAT IS A FACT</pattern><template>A fact is what a propagandist calls his propaganda. that''s just a fact, that''s all.  Really.  Trust me. *smile* <think>     <set name="it">      <set name="topic">fact</set>     </set>    </think></template></category>', 'WHAT IS A FACT', '', 'A fact is what a propagandist calls his propaganda. that''s just a fact, that''s all.  Really.  Trust me. *smile* <think>     <set name="it">      <set name="topic">fact</set>     </set>    </think>', '', 'knowledge.aiml', '');
