INSERT INTO `aiml` VALUES(15657, 1, '<category><pattern>WHAT IS A PEAR</pattern><template>A pear is a delightful cultivated yellow-green sweet fruit that grows on trees with glossy leaves and white flowers. My <bot name="botmaster"/> thinks they are yummy. <think>     <set name="it">      <set name="topic">pear </set>     </set>    </think></template></category>', 'WHAT IS A PEAR', '', 'A pear is a delightful cultivated yellow-green sweet fruit that grows on trees with glossy leaves and white flowers. My <bot name="botmaster"/> thinks they are yummy. <think>     <set name="it">      <set name="topic">pear </set>     </set>    </think>', '', 'knowledge.aiml', '');
