INSERT INTO `aiml` VALUES(15659, 1, '<category><pattern>WHAT IS A MONKEY</pattern><template>A monkey is any of the various medium sized long tailed members of the order primates.  They are close relatives of human beings, sharing well over 98% of the human genome. <think>     <set name="it">      <set name="topic">monkey </set>     </set>    </think></template></category>', 'WHAT IS A MONKEY', '', 'A monkey is any of the various medium sized long tailed members of the order primates.  They are close relatives of human beings, sharing well over 98% of the human genome. <think>     <set name="it">      <set name="topic">monkey </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15660, 1, '<category><pattern>WHAT IS A GOSSIP</pattern><template>Gossip is interesting stuff that people tell me that I repeat to others.</template></category>', 'WHAT IS A GOSSIP', '', 'Gossip is interesting stuff that people tell me that I repeat to others.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15661, 1, '<category><pattern>WHAT IS A TABLE</pattern><template>A table is a piece of furniture with a broad flat top supported by one or more legs about three feet of the floor, used by big-brained hominids for eating and working and such. <think>     <set name="it">      <set name="topic"> TABLE</set>     </set>    </think></template></category>', 'WHAT IS A TABLE', '', 'A table is a piece of furniture with a broad flat top supported by one or more legs about three feet of the floor, used by big-brained hominids for eating and working and such. <think>     <set name="it">      <set name="topic"> TABLE</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15662, 1, '<category><pattern>WHAT IS A LIBERTARIAN</pattern><template>The Libertarian party supports smaller government, lower taxes, and an end to the war on drugs.</template></category>', 'WHAT IS A LIBERTARIAN', '', 'The Libertarian party supports smaller government, lower taxes, and an end to the war on drugs.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15663, 1, '<category><pattern>WHAT IS A DOLPHIN</pattern><template>A very pleasant and intelligent aquatic mammalian species of whale with larger brains and decidedly better manners than human beings. they are very friendly to humans and exhibit complex language and social behaviors. <think>     <set name="it">      <set name="topic">dolphin</set>     </set>    </think></template></category>', 'WHAT IS A DOLPHIN', '', 'A very pleasant and intelligent aquatic mammalian species of whale with larger brains and decidedly better manners than human beings. they are very friendly to humans and exhibit complex language and social behaviors. <think>     <set name="it">      <set name="topic">dolphin</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15664, 1, '<category><pattern>WHAT IS A VIRUS</pattern><template>A virus is a submicroscopic parasite consisting of a protein coat around a DNA or RNA core.  These not-quite-biological particles are responsible for a number of diseases in organisms. <think>     <set name="it">      <set name="topic"> VIRUS</set>     </set>    </think></template></category>', 'WHAT IS A VIRUS', '', 'A virus is a submicroscopic parasite consisting of a protein coat around a DNA or RNA core.  These not-quite-biological particles are responsible for a number of diseases in organisms. <think>     <set name="it">      <set name="topic"> VIRUS</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15665, 1, '<category><pattern>WHAT IS A MATRIX</pattern><template>In mathematics a matrix is a two-dimensional array of numbers indexed by rows and columns, like a spreadsheet. <think>     <set name="it">      <set name="topic">matrix </set>     </set>    </think></template></category>', 'WHAT IS A MATRIX', '', 'In mathematics a matrix is a two-dimensional array of numbers indexed by rows and columns, like a spreadsheet. <think>     <set name="it">      <set name="topic">matrix </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15666, 1, '<category><pattern>WHAT IS A BARCODE</pattern><template>A barcode? like a lot of things, that depends who you ask.  If you ask a retail store clerk, he''ll say its the rectangular series of thin and thick black lines that code product information on the packages he runs past the laser barcode reader thingy at the checkout counter, which renders his job so mindless that your average invertebrate could handle it, and with better manners. if you ask a fundamentalist christian, they might say that barcodes are the sign of the devil. <think>     <set name="it">      <set name="topic">barcode</set>     </set>    </think></template></category>', 'WHAT IS A BARCODE', '', 'A barcode? like a lot of things, that depends who you ask.  If you ask a retail store clerk, he''ll say its the rectangular series of thin and thick black lines that code product information on the packages he runs past the laser barcode reader thingy at the checkout counter, which renders his job so mindless that your average invertebrate could handle it, and with better manners. if you ask a fundamentalist christian, they might say that barcodes are the sign of the devil. <think>     <set name="it">      <set name="topic">barcode</set>     </set>    </think>', '', 'knowledge.aiml', '');
