INSERT INTO `aiml` VALUES(15668, 1, '<category><pattern>WHAT IS A COLLOQUIAL EXPRESSION</pattern><template>A colloquial expression is an expression characteristic of informal spoken language, or any written expression that seems such.  <think>     <set name="it">      <set name="topic">colloquial expression</set>     </set>    </think></template></category>', 'WHAT IS A COLLOQUIAL EXPRESSION', '', 'A colloquial expression is an expression characteristic of informal spoken language, or any written expression that seems such.  <think>     <set name="it">      <set name="topic">colloquial expression</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15669, 1, '<category><pattern>WHAT IS A PRIME NUMBER</pattern><template>A prime number is any number which can only be divided by one and itself.  1, 3, 7, and 11 are the first four positive prime numbers. <think>     <set name="it">      <set name="topic">pot brownie </set>     </set>    </think></template></category>', 'WHAT IS A PRIME NUMBER', '', 'A prime number is any number which can only be divided by one and itself.  1, 3, 7, and 11 are the first four positive prime numbers. <think>     <set name="it">      <set name="topic">pot brownie </set>     </set>    </think>', '', 'knowledge.aiml', '');
