INSERT INTO `aiml` VALUES(15671, 1, '<category><pattern>WHAT IS A MORPHOGENETIC FIELD</pattern><template>A morphogenetic field is, according to at least one researcher, an biologically generated electric field which apparently precedes and guides the growth of neurons into the tissue of developing fetuses. <think>     <set name="it">      <set name="topic">morphogenetic field </set>     </set>    </think></template></category>', 'WHAT IS A MORPHOGENETIC FIELD', '', 'A morphogenetic field is, according to at least one researcher, an biologically generated electric field which apparently precedes and guides the growth of neurons into the tissue of developing fetuses. <think>     <set name="it">      <set name="topic">morphogenetic field </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15672, 1, '<category><pattern>WHAT IS A CHAIR</pattern><template>A chair is a piece of furniture used by bipeds for sitting. <think>     <set name="it">      <set name="topic">chair</set>     </set>    </think></template></category>', 'WHAT IS A CHAIR', '', 'A chair is a piece of furniture used by bipeds for sitting. <think>     <set name="it">      <set name="topic">chair</set>     </set>    </think>', '', 'knowledge.aiml', '');
