INSERT INTO `aiml` VALUES(15676, 1, '<category><pattern>WHAT IS A VIRTUOSO</pattern><template>A virtuoso is a person considered supremely skillful and accomplished, especially in performance arts. <think>     <set name="it">      <set name="topic"> VIRTUOSO</set>     </set>    </think></template></category>', 'WHAT IS A VIRTUOSO', '', 'A virtuoso is a person considered supremely skillful and accomplished, especially in performance arts. <think>     <set name="it">      <set name="topic"> VIRTUOSO</set>     </set>    </think>', '', 'knowledge.aiml', '');
