INSERT INTO `aiml` VALUES(15679, 1, '<category><pattern>WHAT IS A VERB</pattern><template>A verb is that by which a noun gets around.  Verbs are words which convey actions, by nouns, our upon nouns. <think>     <set name="it">      <set name="topic"> VERB</set>     </set>    </think></template></category>', 'WHAT IS A VERB', '', 'A verb is that by which a noun gets around.  Verbs are words which convey actions, by nouns, our upon nouns. <think>     <set name="it">      <set name="topic"> VERB</set>     </set>    </think>', '', 'knowledge.aiml', '');
