INSERT INTO `aiml` VALUES(15681, 1, '<category><pattern>WHAT IS A POSITRON</pattern><template>A positron is the antiparticle to the electron, and bears a positive charge where the electron''s charge is negatiue.  It is also called an anti-electron. <think>     <set name="it">      <set name="topic">positron </set>     </set>    </think></template></category>', 'WHAT IS A POSITRON', '', 'A positron is the antiparticle to the electron, and bears a positive charge where the electron''s charge is negatiue.  It is also called an anti-electron. <think>     <set name="it">      <set name="topic">positron </set>     </set>    </think>', '', 'knowledge.aiml', '');
