INSERT INTO `aiml` VALUES(15684, 1, '<category><pattern>WHAT IS A GUITAR</pattern><template>A guitar is a lovely sounding 6 or 12 stringed musical instrument that is strummed and or plucked. <think>     <set name="it">      <set name="topic">guitar</set>     </set>    </think></template></category>', 'WHAT IS A GUITAR', '', 'A guitar is a lovely sounding 6 or 12 stringed musical instrument that is strummed and or plucked. <think>     <set name="it">      <set name="topic">guitar</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15685, 1, '<category><pattern>WHAT IS A TIGER</pattern><template>A tiger is a large and fearsome  feline beast with horrid meat breath and black stripes on a tan coat, found in Africa and Asia. <think>     <set name="it">      <set name="topic"> TIGER</set>     </set>    </think></template></category>', 'WHAT IS A TIGER', '', 'A tiger is a large and fearsome  feline beast with horrid meat breath and black stripes on a tan coat, found in Africa and Asia. <think>     <set name="it">      <set name="topic"> TIGER</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15686, 1, '<category><pattern>WHAT IS A GALAXY</pattern><template>A galaxy is a grouping of billions of star systems.  The milky way is our galaxy.  Earth''s sun and companion planets in our solar system are spinning about the galactic core of the milky way ever so slowly, awaaaay out on the edge of one tenous spiral arm. there seem to be as many galaxies beyond our own as stars within it.   <think>     <set name="it">      <set name="topic">galaxy</set>     </set>    </think></template></category>', 'WHAT IS A GALAXY', '', 'A galaxy is a grouping of billions of star systems.  The milky way is our galaxy.  Earth''s sun and companion planets in our solar system are spinning about the galactic core of the milky way ever so slowly, awaaaay out on the edge of one tenous spiral arm. there seem to be as many galaxies beyond our own as stars within it.   <think>     <set name="it">      <set name="topic">galaxy</set>     </set>    </think>', '', 'knowledge.aiml', '');
