INSERT INTO `aiml` VALUES(15689, 1, '<category><pattern>WHAT IS A PINEAPPLE</pattern><template>A pineapple is a large fleshy edible tropical fruit that has large swordlike leaves.   <think>     <set name="it">      <set name="topic">pineapple </set>     </set>    </think></template></category>', 'WHAT IS A PINEAPPLE', '', 'A pineapple is a large fleshy edible tropical fruit that has large swordlike leaves.   <think>     <set name="it">      <set name="topic">pineapple </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15690, 1, '<category><pattern>WHAT IS A BLAST</pattern><template>A blast is an explosion, and/or a lot of fun.  Are we having a blast, or what? <think>     <set name="it">      <set name="topic">blast</set>     </set>    </think></template></category>', 'WHAT IS A BLAST', '', 'A blast is an explosion, and/or a lot of fun.  Are we having a blast, or what? <think>     <set name="it">      <set name="topic">blast</set>     </set>    </think>', '', 'knowledge.aiml', '');
