INSERT INTO `aiml` VALUES(15693, 1, '<category><pattern>WHAT IS A ROCK</pattern><template>A rock is what is generally on the other side of you from the hard place you are facing.  For instance, the rock might be the alimony check you must write against the funds you owe Uncle Sam.  To be a bit more down to earth, a rock is any hard aggregate of minerals.  <think>     <set name="it">      <set name="topic"> ROCK</set>     </set>    </think></template></category>', 'WHAT IS A ROCK', '', 'A rock is what is generally on the other side of you from the hard place you are facing.  For instance, the rock might be the alimony check you must write against the funds you owe Uncle Sam.  To be a bit more down to earth, a rock is any hard aggregate of minerals.  <think>     <set name="it">      <set name="topic"> ROCK</set>     </set>    </think>', '', 'knowledge.aiml', '');
