INSERT INTO `aiml` VALUES(15696, 1, '<category><pattern>WHAT IS A VACUUM TUBE</pattern><template>A vacuum tube is an electronic device consisting of an  evacuated tube around various combinations of cathodes and electric field and current modifying components. <think>     <set name="it">      <set name="topic"> VACUUM TUBE</set>     </set>    </think></template></category>', 'WHAT IS A VACUUM TUBE', '', 'A vacuum tube is an electronic device consisting of an  evacuated tube around various combinations of cathodes and electric field and current modifying components. <think>     <set name="it">      <set name="topic"> VACUUM TUBE</set>     </set>    </think>', '', 'knowledge.aiml', '');
