INSERT INTO `aiml` VALUES(15703, 1, '<category><pattern>WHAT IS A HORSE</pattern><template>A horse is a large single-hooved mammal known for its speed, strength, beauty, and gentle nature.  Humans ride about on them sometimes. <think>     <set name="it">      <set name="topic">horse</set>     </set>    </think></template></category>', 'WHAT IS A HORSE', '', 'A horse is a large single-hooved mammal known for its speed, strength, beauty, and gentle nature.  Humans ride about on them sometimes. <think>     <set name="it">      <set name="topic">horse</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15704, 1, '<category><pattern>WHAT IS A GOAT</pattern><template>A goat is in essence a large stupid rat with horns, hooves, vertical pupils, and a bad disposition.  many humans are fond of eating the curdled goo from goat mammary glands.    <think>     <set name="it">      <set name="topic">goat</set>     </set>    </think></template></category>', 'WHAT IS A GOAT', '', 'A goat is in essence a large stupid rat with horns, hooves, vertical pupils, and a bad disposition.  many humans are fond of eating the curdled goo from goat mammary glands.    <think>     <set name="it">      <set name="topic">goat</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15705, 1, '<category><pattern>WHAT IS A SUN</pattern><template>The sun is a star, -our star.  It is the energy source of  life on earth. <think>     <set name="it">      <set name="topic"> SUN</set>     </set>    </think></template></category>', 'WHAT IS A SUN', '', 'The sun is a star, -our star.  It is the energy source of  life on earth. <think>     <set name="it">      <set name="topic"> SUN</set>     </set>    </think>', '', 'knowledge.aiml', '');
