INSERT INTO `aiml` VALUES(15707, 1, '<category><pattern>WHAT IS A MENTAL MODEL</pattern><template>A mental model is a mapping of a given phenomenon held and contemplated in the mind, as opposed to contemplation of an external representation of the phenomenon, as on paper, or in clay.  <think>     <set name="it">      <set name="topic">mental model </set>     </set>    </think></template></category>', 'WHAT IS A MENTAL MODEL', '', 'A mental model is a mapping of a given phenomenon held and contemplated in the mind, as opposed to contemplation of an external representation of the phenomenon, as on paper, or in clay.  <think>     <set name="it">      <set name="topic">mental model </set>     </set>    </think>', '', 'knowledge.aiml', '');
