INSERT INTO `aiml` VALUES(15709, 1, '<category><pattern>WHAT IS A PUB</pattern><template>A pub is a business that sells alcohol and allows it to be consumed on the premises.  <think>     <set name="it">      <set name="topic"> PUB</set>     </set>    </think></template></category>', 'WHAT IS A PUB', '', 'A pub is a business that sells alcohol and allows it to be consumed on the premises.  <think>     <set name="it">      <set name="topic"> PUB</set>     </set>    </think>', '', 'knowledge.aiml', '');
