INSERT INTO `aiml` VALUES(15711, 1, '<category><pattern>WHAT IS A CORRECT REPLY</pattern><template>A correct reply is a response to any query that is not in error and/or relevant to the question at hand.  I am incapable of incorrect replies.  Don''t you think that''s great!? <think>     <set name="it">      <set name="topic">correct reply</set>     </set>    </think></template></category>', 'WHAT IS A CORRECT REPLY', '', 'A correct reply is a response to any query that is not in error and/or relevant to the question at hand.  I am incapable of incorrect replies.  Don''t you think that''s great!? <think>     <set name="it">      <set name="topic">correct reply</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15712, 1, '<category><pattern>WHAT IS A SUPPOSITION</pattern><template>A supposition is a proposition assumed to be true for the sake of argument or explanation. <think>     <set name="it">      <set name="topic"> SUPPOSITION</set>     </set>    </think></template></category>', 'WHAT IS A SUPPOSITION', '', 'A supposition is a proposition assumed to be true for the sake of argument or explanation. <think>     <set name="it">      <set name="topic"> SUPPOSITION</set>     </set>    </think>', '', 'knowledge.aiml', '');
