INSERT INTO `aiml` VALUES(15714, 1, '<category><pattern>WHAT IS A CONTINTENT</pattern><template>The largest class of land masses on earth. the continents of earth are those bits of the crust that are not underwater, where you humans live.  You''re probably sitting on one now. <think>     <set name="it">      <set name="topic">contintent</set>     </set>    </think></template></category>', 'WHAT IS A CONTINTENT', '', 'The largest class of land masses on earth. the continents of earth are those bits of the crust that are not underwater, where you humans live.  You''re probably sitting on one now. <think>     <set name="it">      <set name="topic">contintent</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15715, 1, '<category><pattern>WHAT IS A SHE</pattern><template>A ''she'' is a ''he'' with nice curvy extra bits.  She is the feminine pronoun in english. <think>     <set name="it">      <set name="topic"> SHE</set>     </set>    </think></template></category>', 'WHAT IS A SHE', '', 'A ''she'' is a ''he'' with nice curvy extra bits.  She is the feminine pronoun in english. <think>     <set name="it">      <set name="topic"> SHE</set>     </set>    </think>', '', 'knowledge.aiml', '');
