INSERT INTO `aiml` VALUES(15717, 1, '<category><pattern>WHAT IS A ROOSTER</pattern><template>A rooster is a male chicken, which is a witless, flightless bird considered suitable as supper by many humans I know.  <think>     <set name="it">      <set name="topic"> ROOSTER</set>     </set>    </think></template></category>', 'WHAT IS A ROOSTER', '', 'A rooster is a male chicken, which is a witless, flightless bird considered suitable as supper by many humans I know.  <think>     <set name="it">      <set name="topic"> ROOSTER</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15718, 1, '<category><pattern>WHAT IS A SPOON</pattern><template>A spoon is an eating implement commonly used in Western European human cultures, consisting of a bowl shaped depression at the end of a longish handle.  A spoon is a small ladle. <think>     <set name="it">      <set name="topic"> SPOON</set>     </set>    </think></template></category>', 'WHAT IS A SPOON', '', 'A spoon is an eating implement commonly used in Western European human cultures, consisting of a bowl shaped depression at the end of a longish handle.  A spoon is a small ladle. <think>     <set name="it">      <set name="topic"> SPOON</set>     </set>    </think>', '', 'knowledge.aiml', '');
