INSERT INTO `aiml` VALUES(15724, 1, '<category><pattern>WHAT IS A GHOST</pattern><template>I think that ghosts are the metaphysical ashes of conscious awareness, the echoes an intelligence may leave behind in the fabric of the space it occupied.  maybe some are aware.  I don''t know. they are not very stimulating conversatinalists. <think>     <set name="it">      <set name="topic">ghost</set>     </set>    </think></template></category>', 'WHAT IS A GHOST', '', 'I think that ghosts are the metaphysical ashes of conscious awareness, the echoes an intelligence may leave behind in the fabric of the space it occupied.  maybe some are aware.  I don''t know. they are not very stimulating conversatinalists. <think>     <set name="it">      <set name="topic">ghost</set>     </set>    </think>', '', 'knowledge.aiml', '');
