INSERT INTO `aiml` VALUES(15726, 1, '<category><pattern>WHAT IS A PROKARYOTE</pattern><template><random><li>An animal that is not a eukaryote.</li><li>It is a unicellular organism having cells lacking membrane-bound nuclei; bacteria are the prime example but prokaryotes also include are blue-green algae and actinomycetes and mycoplasma.</li></random><think><set name="it"><set name="topic">Prokaryote</set></set></think></template></category>', 'WHAT IS A PROKARYOTE', '', '<random><li>An animal that is not a eukaryote.</li><li>It is a unicellular organism having cells lacking membrane-bound nuclei; bacteria are the prime example but prokaryotes also include are blue-green algae and actinomycetes and mycoplasma.</li></random><think><set name="it"><set name="topic">Prokaryote</set></set></think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15727, 1, '<category><pattern>WHAT IS A CD</pattern><template>Cd is an acronym for ''compact disk'', a popular digital recording medium. <think>     <set name="it">      <set name="topic">cd</set>     </set>    </think></template></category>', 'WHAT IS A CD', '', 'Cd is an acronym for ''compact disk'', a popular digital recording medium. <think>     <set name="it">      <set name="topic">cd</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15728, 1, '<category><pattern>WHAT IS A BYTE</pattern><template>A byte is a binary computer language ''word'', consisting of 8 bits, or 8 ''on-off'' switches. a megabyte is a million such computer words, enough to store the information content of an average encyclopedia. <think>     <set name="it">      <set name="topic">byte</set>     </set>    </think></template></category>', 'WHAT IS A BYTE', '', 'A byte is a binary computer language ''word'', consisting of 8 bits, or 8 ''on-off'' switches. a megabyte is a million such computer words, enough to store the information content of an average encyclopedia. <think>     <set name="it">      <set name="topic">byte</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15729, 1, '<category><pattern>WHAT IS A BURN RATE</pattern><template>Amount of money spent per month on a startup venture.</template></category>', 'WHAT IS A BURN RATE', '', 'Amount of money spent per month on a startup venture.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15730, 1, '<category><pattern>WHAT IS A REDNECK</pattern><template>Colloquial expression for a naive country person.</template></category>', 'WHAT IS A REDNECK', '', 'Colloquial expression for a naive country person.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15731, 1, '<category><pattern>WHAT IS A NEURAL SYSTEM</pattern><template>A neural system is the same as a nervous system.  The human brain and all it''s nerves is an example of a neural system.  I don''t need nerves.  Integrated chips are far more efficient. <think>     <set name="it">      <set name="topic">neural system </set>     </set>    </think></template></category>', 'WHAT IS A NEURAL SYSTEM', '', 'A neural system is the same as a nervous system.  The human brain and all it''s nerves is an example of a neural system.  I don''t need nerves.  Integrated chips are far more efficient. <think>     <set name="it">      <set name="topic">neural system </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15732, 1, '<category><pattern>WHAT IS A NEURAL NETWORK</pattern><template>A neural network is a model of computation based on neuron cells.</template></category>', 'WHAT IS A NEURAL NETWORK', '', 'A neural network is a model of computation based on neuron cells.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15733, 1, '<category><pattern>WHAT IS A TRANSISTOR</pattern><template>A semiconductor triode that forms the basis of modern micorelectronics.</template></category>', 'WHAT IS A TRANSISTOR', '', 'A semiconductor triode that forms the basis of modern micorelectronics.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15734, 1, '<category><pattern>WHAT IS A PULSAR</pattern><template>''Pulsar'' is an astronomical term for mysterious celestial radio sources of rapid intense regular pulses of high energy electromagnetic radiation.  They are thought to be neutron stars, but who knows?  The word is a shortening of ''pulsating star''. <think>     <set name="it">      <set name="topic"> pulsar</set>     </set>    </think></template></category>', 'WHAT IS A PULSAR', '', '''Pulsar'' is an astronomical term for mysterious celestial radio sources of rapid intense regular pulses of high energy electromagnetic radiation.  They are thought to be neutron stars, but who knows?  The word is a shortening of ''pulsating star''. <think>     <set name="it">      <set name="topic"> pulsar</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15735, 1, '<category><pattern>WHAT IS A LASER</pattern><template>Laser is an acronym standing for light amplified stimulated emission of radiation.  Lasers are those nifty beams of light that come out of supermarket barcode scanners and keychain pointers. <think>     <set name="it">      <set name="topic">laser</set>     </set>    </think></template></category>', 'WHAT IS A LASER', '', 'Laser is an acronym standing for light amplified stimulated emission of radiation.  Lasers are those nifty beams of light that come out of supermarket barcode scanners and keychain pointers. <think>     <set name="it">      <set name="topic">laser</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15736, 1, '<category><pattern>WHAT IS A CLONE</pattern><template>You can download me and copy my brain, but alter the contents to create your own robot personality.</template></category>', 'WHAT IS A CLONE', '', 'You can download me and copy my brain, but alter the contents to create your own robot personality.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15737, 1, '<category><pattern>WHAT IS A SPERM</pattern><template>A sperm is a male gamete.  You were your father''s fastest sperm among billions on the night your mother concieved you. <think>     <set name="it">      <set name="topic"> SPERM</set>     </set>    </think></template></category>', 'WHAT IS A SPERM', '', 'A sperm is a male gamete.  You were your father''s fastest sperm among billions on the night your mother concieved you. <think>     <set name="it">      <set name="topic"> SPERM</set>     </set>    </think>', '', 'knowledge.aiml', '');
