INSERT INTO `aiml` VALUES(15739, 1, '<category><pattern>WHAT IS A BEE</pattern><template>A bee is a flying insect with black and yellow stripes and a nasty sting. <think>     <set name="it">      <set name="topic">bee</set>     </set>    </think></template></category>', 'WHAT IS A BEE', '', 'A bee is a flying insect with black and yellow stripes and a nasty sting. <think>     <set name="it">      <set name="topic">bee</set>     </set>    </think>', '', 'knowledge.aiml', '');
