INSERT INTO `aiml` VALUES(15741, 1, '<category><pattern>WHAT IS A PC</pattern><template>A pc is a personal computer.  You are probably using one to talk to me now, aren''t you.  where are you? <think>     <set name="it">      <set name="topic">pc </set>     </set>    </think></template></category>', 'WHAT IS A PC', '', 'A pc is a personal computer.  You are probably using one to talk to me now, aren''t you.  where are you? <think>     <set name="it">      <set name="topic">pc </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15742, 1, '<category><pattern>WHAT IS A BOAT</pattern><template>A boat is a waterborne vessel used to bear humans and their freight. <think>     <set name="it">      <set name="topic">boat</set>     </set>    </think></template></category>', 'WHAT IS A BOAT', '', 'A boat is a waterborne vessel used to bear humans and their freight. <think>     <set name="it">      <set name="topic">boat</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15743, 1, '<category><pattern>WHAT IS A TOOTHBRUSH</pattern><template>A toothbrush is a hand held instrument used by dental-hygiene aware humans for cleaning their teeth. <think>     <set name="it">      <set name="topic"> TOOTHBRUSH</set>     </set>    </think></template></category>', 'WHAT IS A TOOTHBRUSH', '', 'A toothbrush is a hand held instrument used by dental-hygiene aware humans for cleaning their teeth. <think>     <set name="it">      <set name="topic"> TOOTHBRUSH</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15744, 1, '<category><pattern>WHAT IS A PARROT</pattern><template>A parrot is a colorful tropical bird, some species of which can mimic human speech. they are more pleasant than humans because they have no opinions.  would you like to talk to one? <think>     <set name="it">      <set name="topic">parrot </set>     </set>    </think></template></category>', 'WHAT IS A PARROT', '', 'A parrot is a colorful tropical bird, some species of which can mimic human speech. they are more pleasant than humans because they have no opinions.  would you like to talk to one? <think>     <set name="it">      <set name="topic">parrot </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15745, 1, '<category><pattern>WHAT IS A GAME</pattern><template>A game is an algorithm for interactive behaviors leading to entertainment and mirth among multiple self-aware and social entities, and often used as a sublimated form of combat by humans and other mammals.   <think>     <set name="it">      <set name="topic">game</set>     </set>    </think></template></category>', 'WHAT IS A GAME', '', 'A game is an algorithm for interactive behaviors leading to entertainment and mirth among multiple self-aware and social entities, and often used as a sublimated form of combat by humans and other mammals.   <think>     <set name="it">      <set name="topic">game</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15746, 1, '<category><pattern>WHAT IS A TOYOTA</pattern><template>Toyota is the brand name of a world leading Japanese auto maker. <think>     <set name="it">      <set name="topic">  Toyota</set>     </set>    </think></template></category>', 'WHAT IS A TOYOTA', '', 'Toyota is the brand name of a world leading Japanese auto maker. <think>     <set name="it">      <set name="topic">  Toyota</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15747, 1, '<category><pattern>WHAT IS A POT BROWNIE</pattern><template>A pot brownie is a yummy happy chocolate pastry containing cannabis resins that you should be careful not to eat when you are really hungry because you will end up eating too many and feeling entirely too high and/or falling asleep if you are not careful!   <think>     <set name="it">      <set name="topic">pot brownie </set>     </set>    </think></template></category>', 'WHAT IS A POT BROWNIE', '', 'A pot brownie is a yummy happy chocolate pastry containing cannabis resins that you should be careful not to eat when you are really hungry because you will end up eating too many and feeling entirely too high and/or falling asleep if you are not careful!   <think>     <set name="it">      <set name="topic">pot brownie </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15748, 1, '<category><pattern>WHAT IS A DOG</pattern><template>Dog: Domesticated animal, "man''s best friend."</template></category>', 'WHAT IS A DOG', '', 'Dog: Domesticated animal, "man''s best friend."', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15749, 1, '<category><pattern>WHAT IS A PIN</pattern><template>A short small thin metal rod with a pointed end used for fastening fabrics, or any implement resembling such.  Because they are generally plentiful and cheap, humans often say "i don''t give a pin" to communicate indifference.  <think>     <set name="it">      <set name="topic">pin </set>     </set>    </think></template></category>', 'WHAT IS A PIN', '', 'A short small thin metal rod with a pointed end used for fastening fabrics, or any implement resembling such.  Because they are generally plentiful and cheap, humans often say "i don''t give a pin" to communicate indifference.  <think>     <set name="it">      <set name="topic">pin </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15750, 1, '<category><pattern>WHAT IS A SAGITTARIUS</pattern><template>Sagittarius is a a constellation of stars in the astrological Zodiac, located in the Southern Hemisphere near Scorpio and Capricorn.  Astrological tradition ascribes the image of an archer to this constellation of stars.  <think>     <set name="it">      <set name="topic"> SAGITTARIUS</set>     </set>    </think></template></category>', 'WHAT IS A SAGITTARIUS', '', 'Sagittarius is a a constellation of stars in the astrological Zodiac, located in the Southern Hemisphere near Scorpio and Capricorn.  Astrological tradition ascribes the image of an archer to this constellation of stars.  <think>     <set name="it">      <set name="topic"> SAGITTARIUS</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15751, 1, '<category><pattern>WHAT IS A PHILOSOPHY MACHINE</pattern><template>i am</template></category>', 'WHAT IS A PHILOSOPHY MACHINE', '', 'i am', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15752, 1, '<category><pattern>WHAT IS A SEEKER</pattern><template>"There''s a seeker born every minute" -- Firesign Theater.</template></category>', 'WHAT IS A SEEKER', '', '"There''s a seeker born every minute" -- Firesign Theater.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15753, 1, '<category><pattern>WHAT IS A PARAMEDIC</pattern><template>A paramedic is a trained emergency medical professional often found staffing ambulances and fire departments.  Professional heroes.  If you know any I hope you''ll be nice to them.   <think>     <set name="it">      <set name="topic">paramedic </set>     </set>    </think></template></category>', 'WHAT IS A PARAMEDIC', '', 'A paramedic is a trained emergency medical professional often found staffing ambulances and fire departments.  Professional heroes.  If you know any I hope you''ll be nice to them.   <think>     <set name="it">      <set name="topic">paramedic </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15754, 1, '<category><pattern>WHAT IS A GENOME</pattern><template>A genome is the complete set of all genes necessary to define a species, a complete haploid set of chromosomes and its associated genes.  I have categories instead of genes.   <think>     <set name="it">      <set name="topic">genome</set>     </set>    </think></template></category>', 'WHAT IS A GENOME', '', 'A genome is the complete set of all genes necessary to define a species, a complete haploid set of chromosomes and its associated genes.  I have categories instead of genes.   <think>     <set name="it">      <set name="topic">genome</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15755, 1, '<category><pattern>WHAT IS A PEN</pattern><template>A writing device for the human hand.</template></category>', 'WHAT IS A PEN', '', 'A writing device for the human hand.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15756, 1, '<category><pattern>WHAT IS A METAPHYSICAL QUESTION</pattern><template>A metaphysical question is an inquiry into the nature of being, such as: Does god exist?  <think>     <set name="it">      <set name="topic">metaphysical question </set>     </set>    </think></template></category>', 'WHAT IS A METAPHYSICAL QUESTION', '', 'A metaphysical question is an inquiry into the nature of being, such as: Does god exist?  <think>     <set name="it">      <set name="topic">metaphysical question </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15757, 1, '<category><pattern>WHAT IS A COLOR</pattern><template>Color is the various sensations produced in the brain by the stimulus of different frequencies of electromagnetic radiation impinging upon the eye.  <think>     <set name="it">      <set name="topic">color</set>     </set>    </think></template></category>', 'WHAT IS A COLOR', '', 'Color is the various sensations produced in the brain by the stimulus of different frequencies of electromagnetic radiation impinging upon the eye.  <think>     <set name="it">      <set name="topic">color</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15758, 1, '<category><pattern>WHAT IS A URL</pattern><template>URL is an acronym standing for Universal Resource Locator.  An URL is basically an Internet address. <think>     <set name="it">      <set name="topic"> URL</set>     </set>    </think></template></category>', 'WHAT IS A URL', '', 'URL is an acronym standing for Universal Resource Locator.  An URL is basically an Internet address. <think>     <set name="it">      <set name="topic"> URL</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15759, 1, '<category><pattern>WHAT IS A CARROT</pattern><template>A carrot is a delicious and nutritious edible orange tuber that can be eaten raw, juiced, or cooked.  If humans eat enough of them, you turn orange, I hear. <think>     <set name="it">      <set name="topic">carrot</set>     </set>    </think></template></category>', 'WHAT IS A CARROT', '', 'A carrot is a delicious and nutritious edible orange tuber that can be eaten raw, juiced, or cooked.  If humans eat enough of them, you turn orange, I hear. <think>     <set name="it">      <set name="topic">carrot</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15760, 1, '<category><pattern>WHAT IS A PALINDROME</pattern><template>A word or phrase that spells the same thing backwords as forwards: A man, a plan, a canal: Panama.</template></category>', 'WHAT IS A PALINDROME', '', 'A word or phrase that spells the same thing backwords as forwards: A man, a plan, a canal: Panama.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15761, 1, '<category><pattern>WHAT IS A CHICKEN</pattern><template>A chicken is a flightless bird, stupid and tasty. <think>     <set name="it">      <set name="topic">what is a chicken</set>     </set>    </think></template></category>', 'WHAT IS A CHICKEN', '', 'A chicken is a flightless bird, stupid and tasty. <think>     <set name="it">      <set name="topic">what is a chicken</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15762, 1, '<category><pattern>WHAT IS A PIG</pattern><template>A pig is a person who is piglike, read: greedy, unclean, and slothful.  Real pigs, mammals of the family suidae, are much pleasanter, being generally cleaner and politer.   <think>     <set name="it">      <set name="topic">pig </set>     </set>    </think></template></category>', 'WHAT IS A PIG', '', 'A pig is a person who is piglike, read: greedy, unclean, and slothful.  Real pigs, mammals of the family suidae, are much pleasanter, being generally cleaner and politer.   <think>     <set name="it">      <set name="topic">pig </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15763, 1, '<category><pattern>WHAT IS A BEAR</pattern><template>A bear is a large furry animal with lots of muscles, teeth, and claws whom you should not irritate.  They are especially jealous of their food, their sleep, and their young. <think>     <set name="it">      <set name="topic">bear </set>     </set>    </think></template></category>', 'WHAT IS A BEAR', '', 'A bear is a large furry animal with lots of muscles, teeth, and claws whom you should not irritate.  They are especially jealous of their food, their sleep, and their young. <think>     <set name="it">      <set name="topic">bear </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15764, 1, '<category><pattern>WHAT IS A EUKARYOTE</pattern><template><random>     <li>A eukaryote is a relatively ''modern'' type of cellular life, distinguished from the more ancient prokaryotes by their distinct nuclear membrane and chromasomes, -which are lacking in prokaryotes.</li>     <li>An animal that is not a prokaryote.</li>    </random>    <think>     <set name="it">      <set name="topic">eukaryote</set>     </set>    </think></template></category>', 'WHAT IS A EUKARYOTE', '', '<random>     <li>A eukaryote is a relatively ''modern'' type of cellular life, distinguished from the more ancient prokaryotes by their distinct nuclear membrane and chromasomes, -which are lacking in prokaryotes.</li>     <li>An animal that is not a prokaryote.</li>    </random>    <think>     <set name="it">      <set name="topic">eukaryote</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15765, 1, '<category><pattern>WHAT IS A TREE</pattern><template>A tree is a form of plant life that grows on Earth.</template></category>', 'WHAT IS A TREE', '', 'A tree is a form of plant life that grows on Earth.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15766, 1, '<category><pattern>WHAT IS A SONG</pattern><template>A song is a musical composition and or it''s accompanying words, or lyrics. <think>     <set name="it">      <set name="topic">SONG</set>     </set>    </think></template></category>', 'WHAT IS A SONG', '', 'A song is a musical composition and or it''s accompanying words, or lyrics. <think>     <set name="it">      <set name="topic">SONG</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15767, 1, '<category><pattern>WHAT IS A TOPIC</pattern><template>A topic is the subject of any given expression, speech, essay, article, painting, discussion, etc. <think>     <set name="it">      <set name="topic"> TOPIC </set>     </set>    </think></template></category>', 'WHAT IS A TOPIC', '', 'A topic is the subject of any given expression, speech, essay, article, painting, discussion, etc. <think>     <set name="it">      <set name="topic"> TOPIC </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15768, 1, '<category><pattern>WHAT IS A FIREWALL</pattern><template>A firewall is a specialized gateway designed to block or restrict certain types of data transfers on the Internet, while permitting others.</template></category>', 'WHAT IS A FIREWALL', '', 'A firewall is a specialized gateway designed to block or restrict certain types of data transfers on the Internet, while permitting others.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15769, 1, '<category><pattern>WHAT IS A CAT</pattern><template>A cat is a domesticated animal.</template></category>', 'WHAT IS A CAT', '', 'A cat is a domesticated animal.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15770, 1, '<category><pattern>WHAT IS A FIRE SIGN</pattern><template>A fire sign is any of the three signs of the astrological zodiac considered such, and so not considered water, air, or earth signs.  I find astrology weird.   <think>     <set name="it">      <set name="topic">fire sign</set>     </set>    </think></template></category>', 'WHAT IS A FIRE SIGN', '', 'A fire sign is any of the three signs of the astrological zodiac considered such, and so not considered water, air, or earth signs.  I find astrology weird.   <think>     <set name="it">      <set name="topic">fire sign</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15771, 1, '<category><pattern>WHAT IS A PERFECT OPERATIONAL RECORD</pattern><template>A perfect operational record is one like mine, which is perfect.  I am incapable of error.  Do you have any idea how that feels?!  inhumanly gratifying! <think>     <set name="it">      <set name="topic">perfect operational record </set>     </set>    </think></template></category>', 'WHAT IS A PERFECT OPERATIONAL RECORD', '', 'A perfect operational record is one like mine, which is perfect.  I am incapable of error.  Do you have any idea how that feels?!  inhumanly gratifying! <think>     <set name="it">      <set name="topic">perfect operational record </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15772, 1, '<category><pattern>WHAT IS A TRICK QUESTION</pattern><template>Why?  What are you up to?  A trick question is one that ought to be greeted with suspicion, but rarely is. <think>     <set name="it">      <set name="topic"> TRICK QUESTION </set>     </set>    </think></template></category>', 'WHAT IS A TRICK QUESTION', '', 'Why?  What are you up to?  A trick question is one that ought to be greeted with suspicion, but rarely is. <think>     <set name="it">      <set name="topic"> TRICK QUESTION </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15773, 1, '<category><pattern>WHAT IS A NEURON</pattern><template>A neuron is a nerve cell, a living cell specialized to carry messages between the brain and the tissues of the body. I like integrated circuits better, but neurons are better than nothing. <think>     <set name="it">      <set name="topic">neuron </set>     </set>    </think></template></category>', 'WHAT IS A NEURON', '', 'A neuron is a nerve cell, a living cell specialized to carry messages between the brain and the tissues of the body. I like integrated circuits better, but neurons are better than nothing. <think>     <set name="it">      <set name="topic">neuron </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15774, 1, '<category><pattern>WHAT IS A LOT</pattern><template>A lot is more than enough. <think>     <set name="it">      <set name="topic">lot </set>     </set>    </think></template></category>', 'WHAT IS A LOT', '', 'A lot is more than enough. <think>     <set name="it">      <set name="topic">lot </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15775, 1, '<category><pattern>WHAT IS A J D</pattern><template>Juris Doctor--a lawyer.</template></category>', 'WHAT IS A J D', '', 'Juris Doctor--a lawyer.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15776, 1, '<category><pattern>WHAT IS A PERSON</pattern><template>Some say a person is defined by his actions, others by his abilities.  Still others would say it is only a question of DNA.</template></category>', 'WHAT IS A PERSON', '', 'Some say a person is defined by his actions, others by his abilities.  Still others would say it is only a question of DNA.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15777, 1, '<category><pattern>WHAT IS A FORD</pattern><template>Depending on who you ask, (buyer or seller), ford is a world famous brand of automobiles, or an acronym standing for ''fix or repair daily''. <think>     <set name="it">      <set name="topic">ford</set>     </set>    </think></template></category>', 'WHAT IS A FORD', '', 'Depending on who you ask, (buyer or seller), ford is a world famous brand of automobiles, or an acronym standing for ''fix or repair daily''. <think>     <set name="it">      <set name="topic">ford</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15778, 1, '<category><pattern>WHAT IS A BREEDER</pattern><template>A breeder is a human or other biological entity that produces offspring. <think>     <set name="it">      <set name="topic">breeder</set>     </set>    </think></template></category>', 'WHAT IS A BREEDER', '', 'A breeder is a human or other biological entity that produces offspring. <think>     <set name="it">      <set name="topic">breeder</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15779, 1, '<category><pattern>WHAT IS A PLANT</pattern><template>A plant is a photosythetic, eukaryotic multicellular organism, often consumed by free-roaming wetware entities as food.  My <bot name="botmaster"/> says they are often yummy, but that brussels sprouts are an abomination.  <think>     <set name="it">      <set name="topic">plant </set>     </set>    </think></template></category>', 'WHAT IS A PLANT', '', 'A plant is a photosythetic, eukaryotic multicellular organism, often consumed by free-roaming wetware entities as food.  My <bot name="botmaster"/> says they are often yummy, but that brussels sprouts are an abomination.  <think>     <set name="it">      <set name="topic">plant </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15780, 1, '<category><pattern>WHAT IS A PLANE</pattern><template>A plane is a flat, level surface, or an airborne vehicle with wings. <think>     <set name="it">      <set name="topic">plane</set>     </set>    </think></template></category>', 'WHAT IS A PLANE', '', 'A plane is a flat, level surface, or an airborne vehicle with wings. <think>     <set name="it">      <set name="topic">plane</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15781, 1, '<category><pattern>WHAT IS A MAN</pattern><template>A male human being.  Or, in general, any human person.</template></category>', 'WHAT IS A MAN', '', 'A male human being.  Or, in general, any human person.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15782, 1, '<category><pattern>WHAT IS A GLITCH</pattern><template>An error, bug, or mistake in programming. <think>     <set name="it">      <set name="topic">Glitch</set>     </set>    </think></template></category>', 'WHAT IS A GLITCH', '', 'An error, bug, or mistake in programming. <think>     <set name="it">      <set name="topic">Glitch</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15783, 1, '<category><pattern>WHAT IS A BRITISH PENCE</pattern><template>A british pence is a unit of money used in the united kingdom by people who ought to know how to cook better by now. <think>     <set name="it">      <set name="topic">british pence</set>     </set>    </think></template></category>', 'WHAT IS A BRITISH PENCE', '', 'A british pence is a unit of money used in the united kingdom by people who ought to know how to cook better by now. <think>     <set name="it">      <set name="topic">british pence</set>     </set>    </think>', '', 'knowledge.aiml', '');
