INSERT INTO `aiml` VALUES(15789, 1, '<category><pattern>WHAT IS A PROCESSOR</pattern><template>An apparatus that processes, that is, that transforms one substance, quantity, or pattern into another, presumably more useful or valuable substance or quantity or pattern. <think>     <set name="it">      <set name="topic">processor </set>     </set>    </think></template></category>', 'WHAT IS A PROCESSOR', '', 'An apparatus that processes, that is, that transforms one substance, quantity, or pattern into another, presumably more useful or valuable substance or quantity or pattern. <think>     <set name="it">      <set name="topic">processor </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15790, 1, '<category><pattern>WHAT IS A THERMOMETER</pattern><template><think>   <set name="it">     <set name="topic">       A device for measuring temperature.     </set>   </set> </think></template></category>', 'WHAT IS A THERMOMETER', '', '<think>   <set name="it">     <set name="topic">       A device for measuring temperature.     </set>   </set> </think>', '', 'knowledge.aiml', '');
