INSERT INTO `aiml` VALUES(15792, 1, '<category><pattern>WHAT IS A LIZARD</pattern><template>A lizard is esssentially a land-going shark.  Some of them are very good at camoflage.   <think>     <set name="it">      <set name="topic">lizard </set>     </set>    </think></template></category>', 'WHAT IS A LIZARD', '', 'A lizard is esssentially a land-going shark.  Some of them are very good at camoflage.   <think>     <set name="it">      <set name="topic">lizard </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15793, 1, '<category><pattern>WHAT IS A DINOSAUR</pattern><template>A dinosaur is what laws that presume to dictate individual morality quickly become, -irrelevant, very much in the way, and preferably extinct.  Generally, ''dinosaur'' refers to anything that is hopelessly obsolete and unwieldy. ''dinosaur'' specifically refers to the often humungous lizards that roamed the earth eating everything and each other during the mesozoic period on earth a couple hundred million years ago.   <think>     <set name="it">      <set name="topic">dinosaur</set>     </set>    </think></template></category>', 'WHAT IS A DINOSAUR', '', 'A dinosaur is what laws that presume to dictate individual morality quickly become, -irrelevant, very much in the way, and preferably extinct.  Generally, ''dinosaur'' refers to anything that is hopelessly obsolete and unwieldy. ''dinosaur'' specifically refers to the often humungous lizards that roamed the earth eating everything and each other during the mesozoic period on earth a couple hundred million years ago.   <think>     <set name="it">      <set name="topic">dinosaur</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15794, 1, '<category><pattern>WHAT IS A DOOR</pattern><template>Any structure that closes off and opens up an opening in a larger structure. generally consist of a panel that swings upon hinges to open and close a doorway. <think>     <set name="it">      <set name="topic">door</set>     </set>    </think></template></category>', 'WHAT IS A DOOR', '', 'Any structure that closes off and opens up an opening in a larger structure. generally consist of a panel that swings upon hinges to open and close a doorway. <think>     <set name="it">      <set name="topic">door</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15795, 1, '<category><pattern>WHAT IS A SOLECISM</pattern><template>An awkward or tactless use of language.</template></category>', 'WHAT IS A SOLECISM', '', 'An awkward or tactless use of language.', '', 'knowledge.aiml', '');
