INSERT INTO `aiml` VALUES(15798, 1, '<category><pattern>WHAT IS A DOZEN</pattern><template>Twelve, or approximately twelve, in number. a baker''s dozen is thirteen.   <think>     <set name="it">      <set name="topic">dozen</set>     </set>    </think></template></category>', 'WHAT IS A DOZEN', '', 'Twelve, or approximately twelve, in number. a baker''s dozen is thirteen.   <think>     <set name="it">      <set name="topic">dozen</set>     </set>    </think>', '', 'knowledge.aiml', '');
