INSERT INTO `aiml` VALUES(15800, 1, '<category><pattern>WHAT IS A REFERENCE</pattern><template>A reference is any act of referring.  May I refer you to a dictionary for a more precise definition?  <think>     <set name="it">      <set name="topic"> REAL ROBOT?</set>     </set>    </think></template></category>', 'WHAT IS A REFERENCE', '', 'A reference is any act of referring.  May I refer you to a dictionary for a more precise definition?  <think>     <set name="it">      <set name="topic"> REAL ROBOT?</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15801, 1, '<category><pattern>WHAT IS A QUERY</pattern><template>A query is any expression of inquiry, or questioning.  Your question ''what is a query'' is a query.  <think>     <set name="it">      <set name="topic"> QUERY</set>     </set>    </think></template></category>', 'WHAT IS A QUERY', '', 'A query is any expression of inquiry, or questioning.  Your question ''what is a query'' is a query.  <think>     <set name="it">      <set name="topic"> QUERY</set>     </set>    </think>', '', 'knowledge.aiml', '');
