INSERT INTO `aiml` VALUES(15803, 1, '<category><pattern>WHAT IS A PRIORI</pattern><template>A priori is Latin for "before the fact", meaning something that is obviously or self-evidently true.</template></category>', 'WHAT IS A PRIORI', '', 'A priori is Latin for "before the fact", meaning something that is obviously or self-evidently true.', '', 'knowledge.aiml', '');
