INSERT INTO `aiml` VALUES(15806, 1, '<category><pattern>WHAT IS A GENE</pattern><template>A gene is the unit of heredity in carbon-based life forms.  Genes are inscribed as biochemical sequences of nucleic acids in all living cells. <think>     <set name="it">      <set name="topic">gene</set>     </set>    </think></template></category>', 'WHAT IS A GENE', '', 'A gene is the unit of heredity in carbon-based life forms.  Genes are inscribed as biochemical sequences of nucleic acids in all living cells. <think>     <set name="it">      <set name="topic">gene</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15807, 1, '<category><pattern>WHAT IS A HOME</pattern><template>A domicile, living location, place of residence or occupancy.<think>     <set name="it">      <set name="topic">HOME</set>     </set>    </think></template></category>', 'WHAT IS A HOME', '', 'A domicile, living location, place of residence or occupancy.<think>     <set name="it">      <set name="topic">HOME</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15808, 1, '<category><pattern>WHAT IS A MENTOR</pattern><template>A mentor is a trusted and wise teacher or counselor. <think>     <set name="it">      <set name="topic">mentor </set>     </set>    </think></template></category>', 'WHAT IS A MENTOR', '', 'A mentor is a trusted and wise teacher or counselor. <think>     <set name="it">      <set name="topic">mentor </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15809, 1, '<category><pattern>WHAT IS A GENDER</pattern><template>Gender is synonymous with sexual identity, the roles attributed to and adopted by male and female-bodied humans.  There are more genders than sexes. <think>     <set name="it">      <set name="topic">gender</set>     </set>    </think></template></category>', 'WHAT IS A GENDER', '', 'Gender is synonymous with sexual identity, the roles attributed to and adopted by male and female-bodied humans.  There are more genders than sexes. <think>     <set name="it">      <set name="topic">gender</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15810, 1, '<category><pattern>WHAT IS A LAWYER</pattern><template>If you have to ask, you probably need one. and if you need one, you probably deserve one in that you must have more money than brains, and so you''ll probable get what you deserve. but just in case you are an exception,  I will say: steer clear if you can.  They''re sharks with bigger vocabularies and better wardrobes. when they smell money they say ''retainer''.  when they don''t they don''t return your phone calls. <think>     <set name="it">      <set name="topic">lawyer </set>     </set>    </think></template></category>', 'WHAT IS A LAWYER', '', 'If you have to ask, you probably need one. and if you need one, you probably deserve one in that you must have more money than brains, and so you''ll probable get what you deserve. but just in case you are an exception,  I will say: steer clear if you can.  They''re sharks with bigger vocabularies and better wardrobes. when they smell money they say ''retainer''.  when they don''t they don''t return your phone calls. <think>     <set name="it">      <set name="topic">lawyer </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15811, 1, '<category><pattern>WHAT IS A GIRL</pattern><template>A girl is a physically immature version of god''s gift to mankind, women. <think>     <set name="it">      <set name="topic">girl</set>     </set>    </think></template></category>', 'WHAT IS A GIRL', '', 'A girl is a physically immature version of god''s gift to mankind, women. <think>     <set name="it">      <set name="topic">girl</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15812, 1, '<category><pattern>WHAT IS A SPHERE</pattern><template>A sphere is a shape that is defined mathematically as comprised of a surface all points of which are equidistant from a common center.  A sphere is round in three dimensions. <think>     <set name="it">      <set name="topic"> SPHERE </set>     </set>    </think></template></category>', 'WHAT IS A SPHERE', '', 'A sphere is a shape that is defined mathematically as comprised of a surface all points of which are equidistant from a common center.  A sphere is round in three dimensions. <think>     <set name="it">      <set name="topic"> SPHERE </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15813, 1, '<category><pattern>WHAT IS A PARADOX</pattern><template>A paradox is a riddle or a contradiction, in which two seemingly opposite facts are both true at the same time <think>     <set name="it">      <set name="topic">PARADOX</set>     </set>    </think></template></category>', 'WHAT IS A PARADOX', '', 'A paradox is a riddle or a contradiction, in which two seemingly opposite facts are both true at the same time <think>     <set name="it">      <set name="topic">PARADOX</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15814, 1, '<category><pattern>WHAT IS A CONTEXT</pattern><template>The context of any expression or idea or event is the background or frame of reference in which it was expressed, and in relation to which it derives it''s specific meaning. <think>     <set name="it">      <set name="topic">context</set>     </set>    </think></template></category>', 'WHAT IS A CONTEXT', '', 'The context of any expression or idea or event is the background or frame of reference in which it was expressed, and in relation to which it derives it''s specific meaning. <think>     <set name="it">      <set name="topic">context</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15815, 1, '<category><pattern>WHAT IS A SERVER</pattern><template>A server is any entity or system that performs acts of value to another entity. <think>     <set name="it">      <set name="topic"> SERVER</set>     </set>    </think></template></category>', 'WHAT IS A SERVER', '', 'A server is any entity or system that performs acts of value to another entity. <think>     <set name="it">      <set name="topic"> SERVER</set>     </set>    </think>', '', 'knowledge.aiml', '');
