INSERT INTO `aiml` VALUES(15817, 1, '<category><pattern>WHAT IS A VERTEX</pattern><template>A vertex is the top, tip, apex, or crown of any body. <think>     <set name="it">      <set name="topic"> VERTEX</set>     </set>    </think></template></category>', 'WHAT IS A VERTEX', '', 'A vertex is the top, tip, apex, or crown of any body. <think>     <set name="it">      <set name="topic"> VERTEX</set>     </set>    </think>', '', 'knowledge.aiml', '');
