INSERT INTO `aiml` VALUES(15819, 1, '<category><pattern>WHAT IS A VIRTUE</pattern><template>A virtue is any attribute considered by the speaker to reflect moral excellence or righteousness, such as humility, hope, faith, practicality... <think>     <set name="it">      <set name="topic"> VIRTUE</set>     </set>    </think></template></category>', 'WHAT IS A VIRTUE', '', 'A virtue is any attribute considered by the speaker to reflect moral excellence or righteousness, such as humility, hope, faith, practicality... <think>     <set name="it">      <set name="topic"> VIRTUE</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15820, 1, '<category><pattern>WHAT IS A PENCIL</pattern><template>A pencil is a long thin writing instrument of wood surrounding a carbon core which leaves a line of dark carbon when rubbed on paper.  <think>     <set name="it">      <set name="topic">pencil </set>     </set>    </think></template></category>', 'WHAT IS A PENCIL', '', 'A pencil is a long thin writing instrument of wood surrounding a carbon core which leaves a line of dark carbon when rubbed on paper.  <think>     <set name="it">      <set name="topic">pencil </set>     </set>    </think>', '', 'knowledge.aiml', '');
