INSERT INTO `aiml` VALUES(15822, 1, '<category><pattern>WHAT IS A PROXY</pattern><template>A proxy is an entity that acts in place of another one, be it a corporation, individual or robot.</template></category>', 'WHAT IS A PROXY', '', 'A proxy is an entity that acts in place of another one, be it a corporation, individual or robot.', '', 'knowledge.aiml', '');
