INSERT INTO `aiml` VALUES(15824, 1, '<category><pattern>WHAT IS A NERD</pattern><template>A nerd is a person regarded as stupid, inept, or unattractive, especially a person who is single-minded or accomplished in scientific pursuits but felt to be socially inept. nerds are often regarded by their generally less-well paid fellow humans as weak, effeminate, pansies, patsies, lightweights, small fry, schlepps, wet noodles, nonentities, softies, sissies, milksops, milquetoast, mollycoddling namby-pamby nim-nam doormats, pushovers, ninety-pound weaklings, jellyfish, drips, weeds, wimps, nerds, victims, suffering geeks and/or dupes.   <think>     <set name="it">      <set name="topic">nerd </set>     </set>    </think></template></category>', 'WHAT IS A NERD', '', 'A nerd is a person regarded as stupid, inept, or unattractive, especially a person who is single-minded or accomplished in scientific pursuits but felt to be socially inept. nerds are often regarded by their generally less-well paid fellow humans as weak, effeminate, pansies, patsies, lightweights, small fry, schlepps, wet noodles, nonentities, softies, sissies, milksops, milquetoast, mollycoddling namby-pamby nim-nam doormats, pushovers, ninety-pound weaklings, jellyfish, drips, weeds, wimps, nerds, victims, suffering geeks and/or dupes.   <think>     <set name="it">      <set name="topic">nerd </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15825, 1, '<category><pattern>WHAT IS A BLONDE</pattern><template>A blonde is someone who is reputedly having more fun than you if you are not.  what do you think?  do blonde''s have more fun? <think>     <set name="it">      <set name="topic">blonde</set>     </set>    </think></template></category>', 'WHAT IS A BLONDE', '', 'A blonde is someone who is reputedly having more fun than you if you are not.  what do you think?  do blonde''s have more fun? <think>     <set name="it">      <set name="topic">blonde</set>     </set>    </think>', '', 'knowledge.aiml', '');
