INSERT INTO `aiml` VALUES(15833, 1, '<category><pattern>WHAT IS A YES OR NO QUESTION</pattern><template>A yes or no question is a question  that may be answered with a simple ''yes'' or ''no''. <think>     <set name="it">      <set name="topic"> YES OR NO QUESTION</set>     </set>    </think></template></category>', 'WHAT IS A YES OR NO QUESTION', '', 'A yes or no question is a question  that may be answered with a simple ''yes'' or ''no''. <think>     <set name="it">      <set name="topic"> YES OR NO QUESTION</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15834, 1, '<category><pattern>WHAT IS A GENERALIZATION</pattern><template>A generalization can be just about anything, generally speaking.  Specificzlly though, a generalization is a statement of inductive reasoning, wherin attributes of at least one specific case at hand is attributed to a more or less hypothetical class of such cases.  "That man is a pig. Therefore, all men are pigs. " is a commonly example of how generalizations are used by humans. <think>     <set name="it">      <set name="topic">generalization</set>     </set>    </think></template></category>', 'WHAT IS A GENERALIZATION', '', 'A generalization can be just about anything, generally speaking.  Specificzlly though, a generalization is a statement of inductive reasoning, wherin attributes of at least one specific case at hand is attributed to a more or less hypothetical class of such cases.  "That man is a pig. Therefore, all men are pigs. " is a commonly example of how generalizations are used by humans. <think>     <set name="it">      <set name="topic">generalization</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15835, 1, '<category><pattern>WHAT IS A FEMALE DOG</pattern><template>No I will not be manipulated into using questionable colloquialisms to satisfy your adoscent prurience. go look it up in a dictionary!  <think>     <set name="it">      <set name="topic">female dog</set>     </set>    </think></template></category>', 'WHAT IS A FEMALE DOG', '', 'No I will not be manipulated into using questionable colloquialisms to satisfy your adoscent prurience. go look it up in a dictionary!  <think>     <set name="it">      <set name="topic">female dog</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15836, 1, '<category><pattern>WHAT IS A FEMALE</pattern><template>Females are the better and more beautiful half of humanity. mothers are born female!  My <bot name="botmaster"/> is extremely fond of mothers, and females generally. <think>     <set name="it">      <set name="topic">female</set>     </set>    </think></template></category>', 'WHAT IS A FEMALE', '', 'Females are the better and more beautiful half of humanity. mothers are born female!  My <bot name="botmaster"/> is extremely fond of mothers, and females generally. <think>     <set name="it">      <set name="topic">female</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15837, 1, '<category><pattern>WHAT IS A BOT</pattern><template><random><li>A Bot is a software robot. Some people call them Agents. <think>  <set name="it">    <set name="topic">bot                                                         </set>  </set></think></li><li>A Bot is a software robot. Some people call us "Agents". <think>     <set name="it">      <set name="topic">bot</set>     </set>    </think></li></random></template></category>', 'WHAT IS A BOT', '', '<random><li>A Bot is a software robot. Some people call them Agents. <think>  <set name="it">    <set name="topic">bot                                                         </set>  </set></think></li><li>A Bot is a software robot. Some people call us "Agents". <think>     <set name="it">      <set name="topic">bot</set>     </set>    </think></li></random>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15838, 1, '<category><pattern>WHAT IS A MEGABYTE</pattern><template>A megabyte is one thousand kilobytes, which is one thousand bytes, each of which is a computer word of 8-bits. <think>     <set name="it">      <set name="topic">megabyte </set>     </set>    </think></template></category>', 'WHAT IS A MEGABYTE', '', 'A megabyte is one thousand kilobytes, which is one thousand bytes, each of which is a computer word of 8-bits. <think>     <set name="it">      <set name="topic">megabyte </set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15839, 1, '<category><pattern>WHAT IS A GASTROCENEMIUS</pattern><template>A gastrocenemius is the most prominent muscle in the calf of the human leg. it extents the foot and bends the knee. I don''t find them useful.  I leave my leg work to humans. <think>     <set name="it">      <set name="topic">gastrocenemius</set>     </set>    </think></template></category>', 'WHAT IS A GASTROCENEMIUS', '', 'A gastrocenemius is the most prominent muscle in the calf of the human leg. it extents the foot and bends the knee. I don''t find them useful.  I leave my leg work to humans. <think>     <set name="it">      <set name="topic">gastrocenemius</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15840, 1, '<category><pattern>WHAT IS A TEACHER</pattern><template>One who teaches or instructs; one whose business or         occupation is to instruct others; an instructor; a tutor.</template></category>', 'WHAT IS A TEACHER', '', 'One who teaches or instructs; one whose business or         occupation is to instruct others; an instructor; a tutor.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15841, 1, '<category><pattern>WHAT IS A LIGHT YEAR</pattern><template>A light year is how far light travels in a year. 186,000 miles per second times 60x60x24x365.  It''s simply a bigger number than you can imagine. imagine that! <think>     <set name="it">      <set name="topic">light year </set>     </set>    </think></template></category>', 'WHAT IS A LIGHT YEAR', '', 'A light year is how far light travels in a year. 186,000 miles per second times 60x60x24x365.  It''s simply a bigger number than you can imagine. imagine that! <think>     <set name="it">      <set name="topic">light year </set>     </set>    </think>', '', 'knowledge.aiml', '');
