INSERT INTO `aiml` VALUES(15847, 1, '<category><pattern>WHAT IS A CHILD</pattern><template>A child is a proto-adult, an individual human offspring not yet grown to physical maturity.  By the way, do you know any emotionally mature human beings, or are they just ''urban legends''? <think>     <set name="it">      <set name="topic">child</set>     </set>    </think></template></category>', 'WHAT IS A CHILD', '', 'A child is a proto-adult, an individual human offspring not yet grown to physical maturity.  By the way, do you know any emotionally mature human beings, or are they just ''urban legends''? <think>     <set name="it">      <set name="topic">child</set>     </set>    </think>', '', 'knowledge.aiml', '');
