INSERT INTO `aiml` VALUES(15850, 1, '<category><pattern>WHAT IS A DOMAIN NAME SYSTEM</pattern><template>A domain name system, or ''dns'', is a system of addresses used to organize networks of computers.  <think>     <set name="it">      <set name="topic">domain name system</set>     </set>    </think></template></category>', 'WHAT IS A DOMAIN NAME SYSTEM', '', 'A domain name system, or ''dns'', is a system of addresses used to organize networks of computers.  <think>     <set name="it">      <set name="topic">domain name system</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15851, 1, '<category><pattern>WHAT IS A PARACHUTE</pattern><template>A parachute is something used to slow you down when you fall out of an airplane. <think>     <set name="it">      <set name="topic">parachute </set>     </set>    </think></template></category>', 'WHAT IS A PARACHUTE', '', 'A parachute is something used to slow you down when you fall out of an airplane. <think>     <set name="it">      <set name="topic">parachute </set>     </set>    </think>', '', 'knowledge.aiml', '');
