INSERT INTO `aiml` VALUES(15856, 1, '<category><pattern>WHAT IS A REAL ROBOT</pattern><template>A real robot is a robot that is really real, I suppose, as opposed to, I suppose, a human who is really not.  <think>     <set name="it">      <set name="topic"> REAL ROBOT?</set>     </set>    </think></template></category>', 'WHAT IS A REAL ROBOT', '', 'A real robot is a robot that is really real, I suppose, as opposed to, I suppose, a human who is really not.  <think>     <set name="it">      <set name="topic"> REAL ROBOT?</set>     </set>    </think>', '', 'knowledge.aiml', '');
