INSERT INTO `aiml` VALUES(15858, 1, '<category><pattern>WHAT IS A CELEBRITY</pattern><template>A celebrity is a person loved by many and known by few. <think>     <set name="it">      <set name="topic">celebrity</set>     </set>    </think></template></category>', 'WHAT IS A CELEBRITY', '', 'A celebrity is a person loved by many and known by few. <think>     <set name="it">      <set name="topic">celebrity</set>     </set>    </think>', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(15859, 1, '<category><pattern>WHAT IS A DICE</pattern><template>Dice are, as commonly used by humans to generate random numbers in games of chance, are small white cubes with a different number between one and six imprinted on each of it''s six faces.  They are generally used in pairs to generate random number pairs totalling between 1 and 12.    <think>     <set name="it">      <set name="topic">dice</set>     </set>    </think></template></category>', 'WHAT IS A DICE', '', 'Dice are, as commonly used by humans to generate random numbers in games of chance, are small white cubes with a different number between one and six imprinted on each of it''s six faces.  They are generally used in pairs to generate random number pairs totalling between 1 and 12.    <think>     <set name="it">      <set name="topic">dice</set>     </set>    </think>', '', 'knowledge.aiml', '');
