INSERT INTO `aiml` VALUES(16079, 1, '<category><pattern>WHAT IS CAT</pattern><template>Clear-air turbulence. Any of a family (Felidae) of carnivores, including the lion, tiger, cougar, etc., characterized by a lithe body and, in all species but the cheetah, retractile claws. A small, lithe, soft-furred animal (Felis cattus) of this family, domesticated since ancient times and often kept as a pet or for killing mice. Sometimes known as a woman who makes spiteful remarks.</template></category>', 'WHAT IS CAT', '', 'Clear-air turbulence. Any of a family (Felidae) of carnivores, including the lion, tiger, cougar, etc., characterized by a lithe body and, in all species but the cheetah, retractile claws. A small, lithe, soft-furred animal (Felis cattus) of this family, domesticated since ancient times and often kept as a pet or for killing mice. Sometimes known as a woman who makes spiteful remarks.', '', 'knowledge.aiml', '');
INSERT INTO `aiml` VALUES(16080, 1, '<category><pattern>WHAT IS PLUTONIUM</pattern><template>A radioactive, metallic chemical element of the actinide series similar to uranium and neptunium and found in trace quantities in native uranium ores. Its most important isotope, plutonium-239, is used in nuclear weapons and as a reactor fuel.</template></category>', 'WHAT IS PLUTONIUM', '', 'A radioactive, metallic chemical element of the actinide series similar to uranium and neptunium and found in trace quantities in native uranium ores. Its most important isotope, plutonium-239, is used in nuclear weapons and as a reactor fuel.', '', 'knowledge.aiml', '');
